			<p>ماسك ايديا عينة عليا هو حبيبي هو فاديا ماسك ايديا عينة عليا فاتح أحضانة تملى ليا
<br/>مع يسوع انا ماشى في الطريق مافيش رجوع ده مافيش زيه صديق مع يسوع متطمن مش باخاف هو حبيبي ولا غيره قلبي شاف</p>
			<p>مع يسوع مهما تطول الدروب شمسه بتشرق ولا يوم هايكون غروب مع يسوع عمرى ماشوف ظلام هو يحميني يملاني بالسلام</p>
